import React from "react";
import "./Footer.css";

function Footer() {
  return (
    <div className="main-footer">
      <div className="container">
        <div className="row">
          {/* Column1 */}
          <div className="col">
            <h4>SoilLab</h4>
            <h1 className="list-unstyled">
              <li>000-000-0000</li>
              <li>Urbana, IL</li>
              <li>201 N Goodwin Ave</li>
            </h1>
          </div>
        </div>
        <hr />
        <div className="row">
          <p className="col-sm">
            &copy;{new Date().getFullYear()} SoilLab
          </p>
        </div>
      </div>
    </div>
  );
}

export default Footer;
